import { Route, Routes } from "react-router-dom";
import Home from "../pages/home/home";
import Coaches from "../pages/coaches/coaches";

const AppRoutes = () => {
    return (
        <>
            <Routes>
                <Route path="/" element={<Home />}>
                </Route>
                    <Route path="coaches" element={<Coaches/>} />

                
            </Routes>
        </>
    );
}

export default AppRoutes;
